import React from 'react';
import {NavLink} from "react-router-dom"

const Sidebar = props => {
    return (
        <div className="md:w-2/5 xl:w-1/5 bg-gray-800">
            <div className="p-6">
                <p className="uppercase text-white text-2xl tracking-wide text-center font-bold">RestaurantApp</p>

                <p className="mt-3 text-gray-600">Administra tu restaurtan en las siguientes opciones</p>

                <nav>
                    <NavLink activeClassName="text-yellow-500" to="/">Ordenes</NavLink>
                    <NavLink activeClassName="text-yellow-500" to="/menu">Menu</NavLink>
                </nav>
            </div>
        </div>
    );
};



export default Sidebar;
